INSERT INTO `tipo_categoria` VALUES (1,'JORNADA','Se debe diligenciar de acuerdo al valor de la hoja JORNADA. OBLIGATORIO'),(2,'TIPO DE IDENTIFICACIÓN','Registrar el número de documento en el que constan los datos del estudiante para poder identificarlo. Se debe diligenciar de acuerdo al valor de la hoja TIPOIDENTIFICACION. OBLIGATORIO'),(3,'GÉNERO','Se debe diligenciar de acuerdo al valor de la hoja GENERO. OBLIGATORIO'),(4,'ESTADO CIVIL','El estado civil es la situación de las personas físicas determinada por sus relaciones de familia, provenientes del matrimonio o del parentesco, que establece ciertos derechos y deberes. Se debe diligenciar de acuerdo al valor de la hoja ESTADO CIVIL. OBLIGATORIO'),(5,'LUGAR DE ORIGEN','Código DANE, compuesto por 5 dígitos donde los dos primeros son el código del departamento y los 3 siguientes del municipio, usar 00000 si la persona viene del exterior, si no se tiene información usar 00999, ver la hoja MUNICIPIOS. OBLIGATORIO'),(6,'ESTRATO','Hace referencia al estrato socioeconómico al cual pertenece actualmente La Estratificación Socioeconómica comprende la clasificación de los inmuebles residenciales en grupos socioeconómicos homogéneos en sí y heterogéneos entre sí, a través de sus características físicas, del entorno inmediato y del contexto urbano o rural en el que se encuentran. Se debe diligenciar de acuerdo al valor de la hoja ESTRATO. OBLIGATORIO'),(7,'RÉGIMEN DE SALUD','El Sisbén es el Sistema de Identificación de Potenciales beneficiarios de Programas Sociales. Esta es una herramienta de identificación, que organiza a los individuos de acuerdo con su estándar de vida y permite la selección técnica, objetiva, uniforme y equitativa de beneficiarios de los programas sociales que maneja el Estado, de acuerdo con su condición socioeconómica particular. Si una persona ha sido identificada como potencial beneficiario de los programas sociales, es decir que el nivel está entre 1 y 3, podrá acceder a los subsidios que otorga el Estado a través de los diferentes programas y de acuerdo con la reglamentación de cada uno de ellos. Se debe diligenciar de acuerdo al valor de la hoja SISBEN. OBLIGATORIO'),(8,'NIVEL DE FORMACIÓN','Indica el último nivel de formación académica que tiene el estudiante actualmente. La información se debe diligenciar de acuerdo al valor de la hoja NIVEL_DE_FORMACION. OBLIGATORIO'),(9,'OCUPACIÓN','Situación actual en la que se encuentra el estudiante. La información se debe diligenciar de acuerdo al valor de la hoja OCUPACION. OBLIGATORIO'),(10,'DISCAPACIDAD','La información se debe diligenciar de acuerdo al valor de la hoja DISCAPACIDAD. OBLIGATORIO');
/*!40000 ALTER TABLE `tipo_categoria` ENABLE KEYS */;
UNLOCK TABLES;

